import React, { useContext, useEffect } from "react";
import blogContext from "../context/blogs/BlogContext";
import Blogitem from "../components/Blogitem"
import "./Blogitem.css"

export default function UserData(props) {
    const context = useContext(blogContext)
    const history = useNavigate()
    const { blog, getBlogs } = context
    useEffect(() => {
        if (localStorage.getItem('token')) {
            getBlogs()
        }
        else {
            history("/")
        }
    }, [])
    return (
        <>
            <nav class={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
                <div class="container-fluid">
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav">
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="/blog">Home</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="/write">Write</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="/about">About</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="/userdata">Profile</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="/">Logout</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
            <h1 className="headuser">Your Blogs</h1>
            <div className="row my-3">
                {blog.map((blogs) => {
                    return <Blogitem key={blogs._id} blogs={blogs} />
                })}
            </div>
        </>
    )
}
